import React from "react";
import "./css/plugins.css";
import "./css/style.css";
import "./css/templete.css";
import "./css/skin/skin-1.css";

import Markup from "./markup/Markup";
import ScrollToTop from "./markup/ScrollToTop";

function App() {
  return (
    <div className="App">
      <ScrollToTop />
      <Markup />
    </div>
  );
}

export default App;
